import { createSlice } from "@reduxjs/toolkit";

const initialState = {
    firstName:'Dr',
    lastName:'Kalam',
    email:'missileman@drdo.com',
    password:'password'

};

const user = createSlice({
    name:"user",
    initialState
})


console.log(user)

export default user
